import React, { useState } from 'react';
import Card from '../UI/Card/Card';
import FoodItem from '../FoodItem/FoodItem';


const Food = (props) => {
    const [foodList, setFoodList] = useState([
        {food: 'Carbonara', quantity: 0},
        {food: 'Spaghetti', quantity: 0},
        {food: 'Beef Lasagna', quantity: 0},
        {food: 'Aglio Olio', quantity: 0},
        {food: 'Mushroom Soap', quantity: 0},
        {food: 'Cheese Pizza', quantity: 0}
    ]);


    return (
        <Card>
            <ul>
                {foodList.map((item) => {
                    return (
                        <FoodItem food={item.food} quantity={item.quantity}></FoodItem>
                    )
                })}
            </ul>
        </Card>
    )
}

export default Food;
